import React from "react";

import manoSpock from "../../images/engranaje.png";

import { motion } from "framer";

import "./Background.css";

import reactJS from "../../images/reactJS.png";
import html5 from "../../images/html5.png";
import css from "../../images/css.png";
import js from "../../images/js.png";
import mongo from "../../images/mongo.png";
import github from "../../images/github.png";
import git from "../../images/git.png";
import angular from "../..//images/angular.png";

const Background = () => {
  const background = [reactJS, html5, css];
  return (
    <div className="Background">
      <motion.img
        src={background[Math.floor(Math.random() * 2)]}
        alt="Mano Spock"
        animate={{ rotateY: 360 }}
        transition={{ loop: Infinity, ease: "linear", duration: 40 }}
        style={{
          position: "absolute",
          top: "5vw",
          left: "6vw",
          width: "20vw",
          opacity: 0.5,
        }}
      />
      <motion.img
        src={background[Math.floor(Math.random() * 2)]}
        alt="Mano Spock"
        animate={{ rotate: 360 }}
        transition={{ loop: Infinity, ease: "linear", duration: 40 }}
        style={{
          position: "absolute",
          bottom: "5vw",
          left: "8vw",
          width: "18vw",
          opacity: 0.5,
        }}
      />
      <motion.img
        src={background[Math.floor(Math.random() * 2)]}
        alt="Mano Spock"
        animate={{ rotate: 360 }}
        transition={{ loop: Infinity, ease: "linear", duration: 40 }}
        style={{
          position: "absolute",
          top: "3vw",
          right: "5vw",
          width: "16vw",
          opacity: 0.5,
        }}
      />
      <motion.img
        src={background[Math.floor(Math.random() * 2)]}
        alt="Mano Spock"
        animate={{ rotateY: 360 }}
        transition={{ loop: Infinity, ease: "linear", duration: 40 }}
        style={{
          position: "absolute",
          bottom: "7vw",
          right: "8vw",
          width: "18vw",
          opacity: 0.5,
        }}
      />
    </div>
  );
};

export default Background;
